import { Col, Row } from 'antd'
import React from 'react'
import { Redirect, Route } from 'react-router-dom'
import MenuEvo from '../../components/MenuEvo/MenuEvo'


//const user = null;
const user = { id: 1, username: "luis" }


export default function LayoutSecondary({component: Component, ...rest}) {
    return (
        <Route {...rest}>
             {user ? 
             (<>

                

                <Row>
                    <Col span={2} className="menuSide">        
                     <MenuEvo />
                    </Col>
                
                    <Col span={22} className="contentFrame">
                        <Component/>
                    </Col>
                </Row> 
                
             
             </>) : (<Redirect to="/login" />) }
       </Route>
    )
}
